cy.visit("/");
let totalAmount = 0;
let itemCount = 0;
cy.get(".item").each($el => {
  const priceText = $el.find(".item-price").text();
  const price = parseFloat(priceText.replace(/[^0-9.-]+/g, ""));
  totalAmount += price;
  itemCount++;
  cy.wrap($el).find(".item-btn").click();
}).then(() => {
  cy.get(".header-cart-counter span").eq(1).should("have.text", `(${itemCount.toString()})`);
  cy.get(".header-cart-total").should("have.text", `$${totalAmount.toFixed(0).toString()}`);
});

